import logo from '../img/logo.svg';

const Header = () => {
    return (
        <header className='header'>
            <img alt='image of the logo'>image</img>
            <img src={logo} className="App-logo" alt="logo" />
            <div>Login</div>
            <div>signup</div>



        </header>
    )
}

export default Header
